const CryptoJS = require('crypto-js');

const formatTime = () => {
  const date = new Date();
  const year = date.getFullYear();
  const month = date.getMonth() + 1;
  const day = date.getDate();
  return `${year}${month}${day}`;
};

const genRandomString = len => {
  let rdmString = '';
  while (rdmString.length < len) {
    rdmString += ((Math.random() * 37) | 0).toString(36);
  }
  return rdmString;
};

function strTobinary(str) {
  let result = [];
  let list = str.split('');
  for (let i = 0; i < list.length; i++) {
    if (i !== 0) {
      result.push(' ');
    }
    let item = list[i];
    let binaryStr = item.charCodeAt().toString(2);
    result.push(binaryStr);
  }
  return result.join('');
}

function cipher() {
  const date = new Date();
  const timestamp = date.getTime().toString();
  const salt = genRandomString(24);
  var iv = formatTime();
  var enc = DES3.encrypt(timestamp, salt, iv).toString();
  var str = salt + iv + enc;
  return strTobinary(str);
}

const DES3 = {
  encrypt: function(content, key) {
    if (key) {
      return CryptoJS.TripleDES.encrypt(content, CryptoJS.enc.Utf8.parse(key), {
        iv: CryptoJS.enc.Utf8.parse(formatTime()),
        mode: CryptoJS.mode.CBC,
        padding: CryptoJS.pad.Pkcs7
      }).toString();
    }
    return '';
  },
  decrypt: function(content, key) {
    if (content) {
      return CryptoJS.enc.Utf8.stringify(
        CryptoJS.TripleDES.decrypt(content, CryptoJS.enc.Utf8.parse(key), {
          iv: CryptoJS.enc.Utf8.parse(formatTime()),
          mode: CryptoJS.mode.CBC,
          padding: CryptoJS.pad.Pkcs7
        })
      ).toString();
    }
    return '';
  }
};

module.exports.cipher = cipher;
module.exports.DES3 = DES3;

